  `tutores_centro` tinyint(1) NOT NULL DEFAULT '0',
  `tipo_domicilio` enum('laboral','familiar') NOT NULL DEFAULT 'familiar',
  `renta_inferior` tinyint(4) DEFAULT '0',
  `iprem` enum('mayor','menor','no') DEFAULT 'no',
  `acogimiento` tinyint(4) DEFAULT '0',
  `genero` tinyint(1) DEFAULT '0',
  `terrorismo` tinyint(1) DEFAULT '0',
  `parto` tinyint(4) DEFAULT '0',
  `discapacidad_alumno` tinyint(4) DEFAULT '0',
  `discapacidad_hermanos` tinyint(4) DEFAULT '0',
  `nombredisc1` char(50) DEFAULT 'nodata',
  `apellidodisc1` char(50) DEFAULT 'nodata',
  `dnidisc1` char(9) DEFAULT 'nodata',
  `fnacdisc1` date DEFAULT '2020-01-01',
  `nombredisc2` char(50) DEFAULT 'nodata',
  `apellidodisc2` char(50) DEFAULT 'nodata',
  `dnidisc2` char(9) DEFAULT 'nodata',
  `fnacdisc2` date DEFAULT '2020-01-01',
  `nombredisc3` char(50) DEFAULT 'nodata',
  `apellidodisc3` char(50) DEFAULT 'nodata',
  `dnidisc3` char(9) DEFAULT 'nodata',
  `fnacdisc3` date DEFAULT '2020-01-01',
  `tipo_familia_numerosa` tinyint(4) DEFAULT '0',
  `tipo_familia_monoparental` tinyint(4) DEFAULT '0',
  `monoparental` tinyint(4) NOT NULL DEFAULT '0',
  `zona_dfamiliar` enum('A','B','DESC') NOT NULL DEFAULT 'DESC',
  `zona_dtrabajo` enum('A','B','DESC') NOT NULL DEFAULT 'DESC',
  `zona_limitrofe` enum('SI','NO','DESC') NOT NULL DEFAULT 'DESC',
  `zona_trabajo_limitrofe` enum('SI','NO','DESC') NOT NULL DEFAULT 'DESC',
  `proximidad_domicilio` enum('dfamiliar','dlaboral','dflimitrofe','dllimitrofe','sindomicilio') NOT NULL DEFAULT 'sindomicilio',
  `situacion_sobrevenida` tinyint(4) DEFAULT '0',
  `validar_proximidad_domicilio` tinyint(1) NOT NULL DEFAULT '0',
  `validar_situacion_sobrevenida` tinyint(4) DEFAULT '0',
  `validar_tutores_centro` tinyint(1) NOT NULL DEFAULT '0',
  `validar_renta_inferior` tinyint(1) NOT NULL DEFAULT '0',
  `validar_acogimiento` tinyint(1) DEFAULT '0',
  `validar_genero` tinyint(1) DEFAULT '0',
  `validar_terrorismo` tinyint(1) DEFAULT '0',
  `validar_parto` tinyint(4) DEFAULT '0',
  `validar_hnos_centro` tinyint(1) DEFAULT '0',
  `validar_discapacidad_alumno` tinyint(4) DEFAULT '0',
  `validar_discapacidad_hermanos` tinyint(4) DEFAULT '0',
  `validar_tipo_familia_numerosa` tinyint(4) DEFAULT '0',
  `validar_tipo_familia_monoparental` tinyint(4) DEFAULT '0',
  `calle_dlaboral` varchar(200) DEFAULT NULL COMMENT 'calle domicilio laboral',
  `puntos_validados` float DEFAULT '0',
  `puntos_totales` float DEFAULT '0',
  `calle_dllimitrofe` varchar(200) DEFAULT NULL,
  `sitlaboral` tinyint(4) DEFAULT '0',
  `validar_sitlaboral` tinyint(1) DEFAULT '0',
  `marcado_proximidad_domicilio` tinyint(4) DEFAULT '0',
  `marcado_discapacidad` tinyint(4) DEFAULT '0',
  `marcado_numerosa` tinyint(4) DEFAULT '0',
  `marcado_monoparental` tinyint(4) DEFAULT '0',
  `comprobar_renta_inferior` tinyint(4) NOT NULL DEFAULT '0',
  `comprobar_discapacidad_alumno` tinyint(4) NOT NULL DEFAULT '0',
  `comprobar_discapacidad_hermanos` tinyint(4) NOT NULL DEFAULT '0',
  `comprobar_familia_numerosa` tinyint(4) NOT NULL DEFAULT '0',
  `comprobar_familia_monoparental` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id_alumno`),
  CONSTRAINT `baremo_ibfk_1` FOREIGN KEY (`id_alumno`) REFERENCES `alumnos` (`id_alumno`)
