  `vdos_acneae` int(11) DEFAULT '0',
  `vdos_acneae_original` int(11) DEFAULT '0',
  `vtres` int(11) DEFAULT '0',
  `vtres_original` int(11) DEFAULT '0',
  `vtres_acneae` int(11) DEFAULT '0',
  `vtres_acneae_original` int(11) DEFAULT '0',
  `num_sorteo` int(11) DEFAULT '0',
