  `correo` char(100) DEFAULT NULL,
  `token` char(200) DEFAULT 'notoken',
  `reservas_ebo` int(11) DEFAULT '0',
  `reservas_tva` int(11) DEFAULT '0',
  PRIMARY KEY (`id_centro`),
