INSERT INTO `reclamaciones` VALUES ('baremo',256,'','2021-05-06 10:11:32'),('baremo',201,'adjunto certificado discapacidad vigente hasta diciembre 2021','2021-05-06 12:24:54'),('baremo',245,'Tengan en cuentan el impreso de carnet monoparental, que el que adjunte se caduco el 31.12.20 y el informe de discapacidad de Clara Valeria Torrez Palma emitido por el Gobierno de Aragon.','2021-05-06 22:35:16'),('baremo',241,'RECLAMACIÓN BAREMO','2021-05-07 10:44:44'),('baremo',311,'Discapacidad SHEREZADE SOLER','2021-05-07 10:51:12'),('baremo',294,'rebaremación de Ángela González Camino reconsiderando los puntos a los que tiene derecho por pertenencia a familia numerosa y por discapacidad reconocida. Se adjuntan documentos acreditativos de ambas circunstancias.','2021-05-07 11:00:25'),('baremo',258,'Somos familia numerosa especial vigente hasta 31.07.2021, Aroa tiene reconocida discapacidad 47% hasta el 05.04.2022 y vivimos en zona de escolarizacion. Creemos que nuestro baremo son 9 puntos, no 8. Adjuntamos documentos','2021-05-10 10:11:05'),('baremo',257,'No se ha contado el punto por discapacidad de mi hijo Diego alegado en la solicitud. Adjunto certificado','2021-05-10 13:17:03'),('baremo',287,'Añadir el punto de discapacidad presentando documento acreditativo','2021-05-10 16:56:27'),('baremo',1053,'ddddd','2022-03-08 20:46:55'),('baremo',0,'No hay datos','2022-03-11 14:27:49'),('baremo',902,'ddddddddddddd','2022-03-11 14:39:17'),('baremo',1065,'Familia monoparental','2022-03-15 09:32:48'),('baremo',1064,'Padre trabajando en el centro','2022-03-15 09:49:33'),('baremo',1062,'Pusimos domicilio laboral en zona limítrofe en lugar de domicilio familiar en zona limítrofe','2022-03-15 09:58:45'),('baremo',1061,'No se han sumado los puntos por padres trabajando en el Centro','2022-03-15 10:02:26'),('baremo',1137,'prueba','2022-04-26 00:02:40'),('baremo',1238,'Parece existir un error en el baremo. En teoría contábamos con 16 puntos según la aplicación y el centro, pero en el listado sólo tenemos 7. \nSe adjunta de nuevo libro de familia numerosa, certificado discapacidad, centro educativo de la hermana y empadronamiento.\nAñado pantallazos de la aplicación y el listado. \nSolicito subsanación.','2022-04-26 10:24:19'),('baremo',1187,'BAREMO DE DISCAPACIDAD','2022-04-26 10:31:29'),('baremo',1196,'Se adjunta baremo de discapacidad.','2022-04-26 10:47:13'),('baremo',1269,'Adjunto documentacion del domicilio laboral del padre del alumno','2022-04-26 12:55:46'),('baremo',1185,'NO ESTAR DE ACUERDO CON LOS PUNTOS DE BAREMO ASIGNADOS A LA SOLICITUD CONJUNTA DE ESCOLARIZACIÓN. \nSE HAN RESUELTO 6 PUNTOS Y SE PRESENTA DOCUMENTACIÓN PARA JUSTIFICAR 13 PUNTOS. \n4 PUNTOS- POR SOLICITUD CONJUNTA DE HERMANOS. \n6 PUNTOS- DOMICILIO EN ZONA DE ESCOLARIZACIÓN. \n2 PUNTOS- DISCAPACIDAD DE AMBOS HERMANOS. \n1 PUNTO- PARTO MÚLTIPLE. \n\nLA PÁGINA WEB NO PERMITE AÑADIR ARCHIVOS, POR LO QUE SE ENVÍA AL MAIL: lhueso@aragon.es','2022-04-26 13:53:30'),('baremo',1140,'A mi hijo Diego Pina Allo no se le han reconocido todos los puntos baremados.\nAdjunto certificado de discapacidad y título de familia numerosa para su comprobación y la subsanación de errores.\nUn saludo.','2022-04-26 14:05:11'),('baremo',1186,'NO ESTAR DE ACUERDO CON LOS PUNTOS DE BAREMO ASIGNADOS A LA SOLICITUD CONJUNTA DE ESCOLARIZACIÓN. \nSE HAN RESUELTO 6 PUNTOS Y SE PRESENTA DOCUMENTACIÓN PARA JUSTIFICAR 13 PUNTOS. \n4 PUNTOS- POR SOLICITUD CONJUNTA DE HERMANOS. \n6 PUNTOS- DOMICILIO EN ZONA DE ESCOLARIZACIÓN. \n2 PUNTOS- DISCAPACIDAD DE AMBOS HERMANOS. \n1 PUNTO- PARTO MÚLTIPLE. ','2022-04-26 15:11:40'),('baremo',1282,'Al no adjuntar en el momento de realizar la solicitud el libro de familia numerosa, no se le ha contabilizado el punto correspondiente. Adjuntamos documento para que se cuente a efectos de baremo.','2022-04-27 09:48:16'),('baremo',1235,'BUENOS DÍAS\nADJUNTO DOCUMENTACIÓN PARA INDICAR QUE LOS INGRESOS SON INFERIORES AL INGRESO MINIMO  VITAL\n POR LO QUE RECLAMARÍA EL PUNTO ADICIONAL PARA EL BAREMO QUE PASARÍA DE 7 A 8','2022-04-27 11:14:53'),('baremo',1278,'Kelvin tiene 7 puntos baremados (proximidad domicilio 6  y familia numerosa 1).\nSe marcó discapacidad (1 punto). A día de hoy todavía no tiene reconocido grado de discapacidad porque está pendiente de citación (se hizo la solicitud en Marzo). Dado el síndrome que tiene y sus dificultades tiene muchas garantías de que se la vayan a conceder.\n\nPor otro lado, se ha solicitado el IMV (5 puntos) pero todavía no hay respuesta alguna. \n\nPor todo lo comentado, se solicita que se reconsidere el poder baremar estos dos criterios. De ser así, serían 13 puntos los totales. ','2022-04-27 18:43:11'),('provisional',1137,'prueba finalffff','2022-05-04 00:15:59'),('provisional',1174,'Nuestra hija, Julia Bordetas Sánchez, de 12 años de edad, está diagnosticada de Trastorno del Espectro Autista. Ha cursado educación primaria en el aula TEA del Colegio Jesuitas de Zaragoza. La recomendación del departamento de orientación de dicho centro, es el cambio a educación especial para el curso 2022/23.\n\nConsideramos que el Colegio de Educación Especial \"Jean Piaget\" es, desde sus inicios, un centro pionero y especializado en Autismo (aunque atendiendo a la legislación se acojan a alumnos con otras problemáticas), con profesionales muy formados y con amplia experiencia en autismo, tanto es así que el equipo especializado de orientación e inclusión en autismo tiene sede en dicho colegio. \nEstamos convencidos de que el colegio Piaget es el centro que mejor puede dar respuesta a la necesidad educativa de nuestra hija, así como el centro que mejor puede dar continuidad a toda la labor realizada por el equipo TEA del colegio Jesuitas de Zaragoza.\n\nEntendemos y respetamos que tiene que haber baremos objetivos y ordinarios para todos los alumnos, pero creemos que este es un caso especial, y como padres estamos obligados y comprometidos en proporcionar la mejor formación a nuestra hija. Aludimos a su comprensión y solicitamos que se pueda escolarizar a Julia en el Colegio de Educación Especial \"Jean Piaget\", centro que mejor puede ayudar a su completo desarrollo.\n\nMuchas gracias,\n\nEduardo y Sonia, padres de Julia Bordetas Sánchez.\n','2022-05-04 15:56:14'),('provisional',1191,'Estimados/estimadas. \nHe podido comprovar que en la solicitud no se habían adjuntado algunos documentos y que en el espacio de en qué centro estaba escolarizado ELOI VERGÉS ALTADILL aparece vacío, estando escolarizado en el curso 21-22 en San Martín de Porres/Atades, en Zaragoza. Fue complicado desde el sistema IOS rellenar la solicitud, así como adjuntar documentos. También en esta página no ha sido posible adjuntar PDF ni DOC. ës por esta razón que adjunto en este mensaje dos enlaces para que puedan visualizar la documentación.\nMuchas gracias.\nMaria A. Altadill Briansó ( 676 546 045)\n\nRENTA 2020\nhttps://drive.google.com/file/d/1_vok89MYt28blCAck-f1sbP-S6pL8_3l/view?usp=sharing\n\nDOCUMENTO ACREDITATIVO DISCAPACIDAD ELOI VERGÉS ALTADILL\nhttps://drive.google.com/file/d/1tlBbsIbEf31ZqrxNckVtcqYBrSPvRd1c/view?usp=sharing\n','2022-05-05 09:47:12'),('provisional',1261,'Me pongo en contacto con vosotros porque mi hija, Sofía Martínez Buil, teniendo 16 puntos para la solicitud de escolarización en el Centro Rincón de Goya no ha sido admitida. \nEs la solicitud con más puntos de todas.\nMe informan que han tenido prioridad las solicitudes de los pueblos, es una medida muy injusta, debido a que su domicilio también se podría considerar que está en eje de transporte escolar, ya que tienen la entrada a la ciudad con el autobús por Valdespartera. \nTiene dos hermanos más escolarizados en la misma zona, y ya se le quitan los puntos para la segunda opción, estando en la misma posición que si no tuviera hermanos para optar a un colegio cercano a su domicilio.\nAdjunto imágenes del listado baremado y del listado de no admitidos.\nEspero su respuesta, mi teléfono es 665871378. Correo electrónico: patbuil81@hotmail.com\nUn saludo','2022-05-05 11:27:10'),('provisional',1260,'Reclamación de la familia Cuadra Reula, alumno Jordán Cuadra Reula contra las listas provisionales publicadas a fecha 3 de mayo de 2022 del Proceso de Escolarización de Educación Especial. Periodo Ordinario 2022-2023 del Gobierno de Aragón.\n\nMaría Reula Baquero con NIF 25463443M y Jesús María Cuadra Gracia con NIF 29761991V, madre y padre del alumno Jordán Cuadra Reula, presentamos esta reclamación contra las listas provisionales en el Servicio Provincial de Educación del Gobierno de Aragón y en el CEE Alborada.\n\nEl detalle de la reclamación, dada su longitud, se expone en el fichero pdf adjunto detalle_reclamación_familia_cuadra.pdf\n\nUn saludo\n\n','2022-05-05 11:29:28'),('provisional',1230,'Hola nos avisaron desde el colegio  Rincon de Goya que mi hijo David Andrei Cucu no ha entrado que tenían prioridad los de los pueblos ,mi pregunta es mi hijo que vive a 10 minutos andando de este colegio porque no tiene la oportunidad de entrar ya que pedimos un público porque nos cae cerca ,y encima tenemos más puntos que los que ya están aprobados ,que nos queda empadronados en cuarte  o en otro sitio  para que mi hijo tenga una plaza cerca de casa ya que vivimos en torero para que tenga un colegio cerca .no me parece nada justo lo que se hace con estos niños  encima que donde estaba antes me obligaron salir fuera del cole encima teniendo aula TEA que creo que están preparados para tenerla   encima les dais otra clase más de aula Tea este año pero mi hijo obligado en salir de ay porque así lo decidieron ellos ahora me encuentro que tampoco no tiene plaza en los colegios que yo elegí. Estoy muy cabreada la verdad ','2022-05-05 11:54:31'),('provisional',1252,'No hay datos','2022-05-05 15:35:33'),('baremo',1322,'reclamación del alumno 1322, Cebolla','2023-02-08 12:06:37'),('baremo',1329,'No se han validado el apartado de parto múltiple','2023-02-09 09:56:41'),('baremo',1315,'Olvidé introducir documentación de víctima de terrorismo.\nAdjunto documento','2023-02-09 11:17:09'),('provisional',1332,'Reclamación  provisiojnal de ceboola','2023-02-13 11:09:57'),('provisional',1359,'reclamacion  pruebas','2023-02-13 11:49:39'),('provisional',1323,'Mi solicitud no es irregular','2023-02-13 13:33:11'),('provisional',1322,'No me han contado los puntos\n','2023-02-13 14:16:57');
